/* eslint-disable no-unused-vars */
import React, {useState , useEffect} from 'react'

function Aplicacao(){  

    //armazenar dados
    const [ presidente, setPresidente] = useState([])

    //pega dados
    useEffect(() => {
        Dados()

    }, []) 

        // obtem os dados da API 
        // fetch para fazer a requisicao da API
    const Dados = async () => {
        const dadosRepo = await fetch ('https://infograficos-eleicoes-oglobo.s3.amazonaws.com/2022/1-turno/apuracao/presidente/presidente_brasil.json')

        //converte os dados para json
        const coverter = await dadosRepo.json()
        console.log(dadosRepo, coverter);
        setPresidente(coverter.c)
    }

    return(
        <div>
          <table>
          <tbody>
          <tr>
            <th>Nome Candidato</th>
            <th >Partido</th>
            <th>Quantidade de votos</th>
          </tr>

          <td>
            {presidente.map(candidato => (<tr key={candidato.nc}>{candidato.nc} ,{candidato.p}</tr>

            ) )}

           </td>
           </tbody>
        </table>
       </div>
    )

} 


export default Aplicacao
